{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/laurallm/cyclistic?scriptVersionId=156837268\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"793d69c3","metadata":{"papermill":{"duration":0.009624,"end_time":"2023-12-28T11:41:19.414123","exception":false,"start_time":"2023-12-28T11:41:19.404499","status":"completed"},"tags":[]},"source":["# Pedaling Towards Success: How Cyclistic's Data Analysis Transforms Casual Riders into Annual Members\n","\n","<img src=\"https://cdn.vox-cdn.com/thumbor/EYpdchXsdupWU_mZGrwvH6KA1-I=/1400x1400/filters:format(jpeg)/cdn.vox-cdn.com/uploads/chorus_asset/file/11715067/shutterstock_525161920.jpg\" width=\"500\"/>\n","\n","## Introduction\n","\n","As a requirement of the [Google Data Analytics Professional Certificate course](https://www.coursera.org/account/accomplishments/specialization/certificate/VU7EQBTJAGK8), the successful completion of this final project is essential to showcase the acquired skills.\n","\n","## Scenario\n","\n","Cyclistic launched a successful bike-share program in 2016, with a fleet of 5,824 bikes across 692 stations in Chicago. The program offers flexible pricing plans to attract casual riders and annual members. Financial analysts have found that annual members are more profitable. The marketing team is working to convert casual riders into annual members by analyzing historical bike trip data. Their goal is to design marketing strategies to attract more annual members by understanding the differences between casual and annual riders.\n","\n","Three questions will guide the future marketing program:\n","\n","- How do annual members differ from casual riders in their use of Cyclistic bikes?\n","- Why would casual riders purchase annual memberships of Cyclistic?\n","- How can Cyclistic use digital media to influence casual riders to become members?\n","\n","As a junior data analyst, the marketing director assigned you to answer the first question. You will create a report with the following deliverables:\n","\n","* Clear instruction of the business task\n","* Description of all data sources used\n","* Documentation of all data cleaning and manipulation\n","* Summary of your analysis\n","* Supporting visualizations and key findings\n","* The top three recommendations based on your analysis.\n","\n","# Ask\n","\n","In order to guide the goal establishment, help to focus the effort and improve the chance to reach the correct goal, the question will be transform following the **SMART** requirements. As a reminder a SMART question must be:\n","\n","- **S**pecific\n","- **M**easurable\n","- **A**chievable\n","- **R**elevant\n","- **T**ime-based\n","\n","Following this requirements, the SMART question is: \n","\n","What are the main differences in terms of usage frequency, duration, and destinations between Cyclistic's annual members and occasional riders in the last year, in order to identify opportunities to convert occasional riders into members and increase the number of annual members in the future?\n","\n","# Prepare\n","\n","The historical datasets are provided by [Motivate International Inc](https://divvy-tripdata.s3.amazonaws.com/index.html) under this [license](https://ride.divvybikes.com/data-license-agreement). It is necessary to use the last 12 months datasets to obtain a sufficient sample of the data that needs to be analyzed.\n","\n","###### *Note: This is public data that can be used to explore how the types of customers who use Cyclistic bikes differ. Please note, however, that for data privacy reasons, it is prohibited from using riders' personally identifiable information. This means it won't be able to match pass purchases to credit card numbers to determine if casual cyclists live in Cyclistic's service area or if they purchased multiple passes for a single ride.*\n","\n","This data source is legit and pure because it comes straight from the primary source of said information. Plus, as shown, it contains all the relevant information for analysis as of the current date. Lastly, Motivate International Inc. takes care of updating their own information in a recurring fashion.\n","\n","All these features make our data source **ROCCC** compliant.\n","\n","# Proccess\n","\n","Considering the amount of information included in each dataset, to facilitate the analysis, cleaning, and transformation of the information, **RStudio** will be used."]},{"cell_type":"code","execution_count":1,"id":"78700e15","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2023-12-28T11:41:19.434898Z","iopub.status.busy":"2023-12-28T11:41:19.432696Z","iopub.status.idle":"2023-12-28T11:41:21.942137Z","shell.execute_reply":"2023-12-28T11:41:21.940277Z"},"papermill":{"duration":2.522022,"end_time":"2023-12-28T11:41:21.944484","exception":false,"start_time":"2023-12-28T11:41:19.422462","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.4.0      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 1.0.1 \n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.5.0 \n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.3      \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.2 \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","Loading required package: timechange\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n","Registered S3 method overwritten by 'rmutil':\n","  method         from\n","  print.response httr\n","\n"]}],"source":["#Install and load the necessary libraries\n","library(tidyverse)\n","library(lubridate)\n","library(skimr)\n","library(geosphere)\n","library(modeest)\n","options(warns = -1)"]},{"cell_type":"markdown","id":"41d231d8","metadata":{"papermill":{"duration":0.00847,"end_time":"2023-12-28T11:41:21.962694","exception":false,"start_time":"2023-12-28T11:41:21.954224","status":"completed"},"tags":[]},"source":["First, it is necessary to load all the *csv* into different dataframes:"]},{"cell_type":"code","execution_count":2,"id":"45f13019","metadata":{"execution":{"iopub.execute_input":"2023-12-28T11:41:22.009834Z","iopub.status.busy":"2023-12-28T11:41:21.982542Z","iopub.status.idle":"2023-12-28T11:43:28.335355Z","shell.execute_reply":"2023-12-28T11:43:28.333573Z"},"papermill":{"duration":126.366947,"end_time":"2023-12-28T11:43:28.338","exception":false,"start_time":"2023-12-28T11:41:21.971053","status":"completed"},"tags":[]},"outputs":[],"source":["df1 <- read.csv(\"/kaggle/input/google-casestudy-1-2022-2023/202201-divvy-tripdata.csv\")\n","df2 <- read.csv(\"/kaggle/input/google-casestudy-1-2022-2023/202202-divvy-tripdata.csv\")\n","df3 <- read.csv(\"/kaggle/input/google-casestudy-1-2022-2023/202203-divvy-tripdata.csv\")\n","df4 <- read.csv(\"/kaggle/input/google-casestudy-1-2022-2023/202204-divvy-tripdata.csv\")\n","df5 <- read.csv(\"/kaggle/input/google-casestudy-1-2022-2023/202205-divvy-tripdata.csv\")\n","df6 <- read.csv(\"/kaggle/input/google-casestudy-1-2022-2023/202206-divvy-tripdata.csv\")\n","df7 <- read.csv(\"/kaggle/input/google-casestudy-1-2022-2023/202207-divvy-tripdata.csv\")\n","df8 <- read.csv(\"/