87.7 -87.6 ...\n"," $ member_casual     : chr  \"casual\" \"casual\" \"member\" \"casual\" ...\n"]}],"source":["str(all_trips_raw)"]},{"cell_type":"markdown","id":"e623ab2a","metadata":{"papermill":{"duration":0.008985,"end_time":"2023-12-28T11:43:41.613083","exception":false,"start_time":"2023-12-28T11:43:41.604098","status":"completed"},"tags":[]},"source":["In order to have a better understanding of the trip durations it is necessary to create a new column with the difference between *\"ended_at\"* and *\"started_at\"*. Also, for next analysis it is necessary to have one column for the the of the week and another for the month."]},{"cell_type":"code","execution_count":6,"id":"7e484f67","metadata":{"execution":{"iopub.execute_input":"2023-12-28T11:43:41.635183Z","iopub.status.busy":"2023-12-28T11:43:41.633714Z","iopub.status.idle":"2023-12-28T11:44:33.76673Z","shell.execute_reply":"2023-12-28T11:44:33.764921Z"},"papermill":{"duration":52.14694,"end_time":"2023-12-28T11:44:33.769154","exception":false,"start_time":"2023-12-28T11:43:41.622214","status":"completed"},"tags":[]},"outputs":[],"source":["#Creating \"trip_duration\", \"weekday\" and \"month\" columns. Save it in the raw dataframe.\n","\n","all_trips_raw <- all_trips_raw %>% \n","  mutate(trip_duration= (ymd_hms(ended_at)-ymd_hms(started_at))) %>% \n","  mutate(weekday =  wday(all_trips_raw$started_at, label = TRUE, abbr = FALSE)) %>% \n","  mutate(month = format(as.Date(all_trips_raw$started_at), \"%B\"))"]},{"cell_type":"code","execution_count":7,"id":"f2ae01f7","metadata":{"execution":{"iopub.execute_input":"2023-12-28T11:44:33.789949Z","iopub.status.busy":"2023-12-28T11:44:33.788594Z","iopub.status.idle":"2023-12-28T11:44:50.128525Z","shell.execute_reply":"2023-12-28T11:44:50.126547Z"},"papermill":{"duration":16.352505,"end_time":"2023-12-28T11:44:50.130664","exception":false,"start_time":"2023-12-28T11:44:33.778159","status":"completed"},"tags":[]},"outputs":[],"source":["# Translation of coordinates 