wAAAAUwZ8UAwAAUATBDgAAQBEEOwAAAEUQ7AAAABRB\nsAMAAFAEwQ4AAEARBDsAAABFEOwAAAAUQbADAABQxP8D2sDwuoZlOdwAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Summary of total km by user during the week:\n","\n","all_trips %>%  group_by(member_casual, weekday) %>% summarise(total_km = sum(ride_distance))\n","\n","# Visualization of total km ride per user:\n","\n","all_trips %>% \n","    group_by(member_casual, weekday) %>%\n","    summarise(total_km = sum(ride_distance)) %>%\n","    ggplot(aes(x = weekday, y= total_km, fill=member_casual)) +\n","    geom_bar(stat = \"identity\", position = \"dodge\") +\n","    labs(y= \"Total km\", title= \"Weekly Ride Distance by user.\") + \n","    scale_y_continuous(labels = function(x) format(x, scientific = FALSE))"]},{"cell_type":"markdown","id":"0b515e1c","metadata":{"papermill":{"duration":0.016905,"end_time":"2023-12-28T11:45:35.167636","exception":false,"start_time":"2023-12-28T11:45:35.150731","status":"completed"},"tags":[]},"source":["Although the distance covered by members is quite consistent throughout the week, there is a slight drop during the weekend. Wednesdays are the days when the most distance is covered, while Sundays are the days with the least distance covered, with a difference of 27.8%.\n","\n","However, this relationship does not hold true **for casual users**. For them, **the distance covered increases throughout the week, peaking on Saturdays**, with Tuesdays being the days with the least distance covered. The difference between these two days is 48.38%.\n","\n","It is worth noting that on Saturdays, casual users cover more distance than annual members.\n","\n","Taking these data into account, one could establish a certain relationship between annual members and the use of the service for commuting to work, as opposed to occasional cyclists who may use the service for tourism or leisure purposes.\n","\n","Let's explore the relationship from an annual perspective to provide more insight."]},{"cell_type":"code","execution_count":25,"id":"38bd8d2c","metadata":{"execution":{"iopub.execute_input":"2023-12-28T11:45:35.204829Z","iopub.status.busy":"2023-12-28T11:45:35.203166Z","iopub.status.idle":"2023-12-28T11:45:35.923536Z","shell.execute_reply":"2023-12-28T11:45:35.921978Z"},"papermill":{"duration":0.741767,"end_time":"2023-12-28T11:45:35.926021","exception":false,"start_time":"2023-12-28T11:45:35.184254","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'member_casual'. You can override using the\n","`.groups` argument.\n"]},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A grouped_df: 24 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>member_casual</th><th scope=col>month</th><th scope=col>total_km</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;ord&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>casual</td><td>January  </td><td> 33905.62</td></tr>\n","\t<tr><td>casual</td><td>February </td><td> 39513.79</td></tr>\n","\t<tr><td>casual</td><td>March    </td><td>179527.35</td></tr>\n","\t<tr><td>casual</td><td>April    </td><td>254537.15</td></tr>\n","\t<tr><td>casual</td><td>May      </td><td>574664.43</td></tr>\n","\t<tr><td>casual</td><td>June     </td><td>758168.65</td></tr>\n","\t<tr><td>casual</td><td>July     </td><td>832300.23</td></tr>\n","\t<tr><td>casual</td><td>August   </td><td>731833.21</td></tr>\n","\t<tr><td>casual</td><td>September</td><td>600558.19</td></tr>\n","\t<tr><td>casual</td><td>October  </td><td>400365.14</td></tr>\n","\t<tr><td>casual</td><td>November </td><td>195886.57</td></tr>\n","\t<tr><td>casual</td><td>December </td><td> 73009.12</td></tr>\n","\t<tr><td>member</td><td>January  </td><td>148812.40</td></tr>\n","\t<tr><td>member</td><td>February </td><td>167353.55</td></tr>\n","\t<tr><td>member</td><td>March    </